import Navbar from './navbar'

class Header extends React.Component{
    constructor(){
        super();
        this.props = [
            {profile: <>213</>},
            {orders: <>213</>},
            {qanda: <>321</>}
        ]
    }
    render(){
        return(<Navbar {...this.props}/>);
    }
}
export default Header;
